import React from 'react';
import '../css/ActiveUsers.css';

const ActiveUsers = ({ users, onSelectUser }) => {
  return (
    <div className="active-users">
      {users.map((user, index) => (
        <div
          key={index}
          className="user"
          onClick={() => onSelectUser(user)}
        >
          {user.name}
        </div>
      ))}
    </div>
  );
};

export default ActiveUsers;
